const privacy = ()=>{
    return(
        <div className="privacy">
            <h1>Privacy Policy</h1>
            <h2>Title goes here</h2>
            <p>
            Verum ad istam omnem orationem brevis est defensio. Nam quoad aetas M.
            Caeli dare potuit isti suspicioni locum, fuit primum ipsius pudore,
            deinde etiam patris diligentia disciplinaque munita. Qui ut huic
            virilem togam dedit≈°nihil dicam hoc loco de me; tantum sit, quantum
            vos existimatis; hoc dicam, hunc a patre continuo ad me esse deductum;
            nemo hunc M. Caelium in illo aetatis flore vidit nisi aut cum patre
            aut mecum aut in M. Crassi castissima domo, cum artibus honestissimis
            erudiretur.
            </p>
        </div>
        
    )
}
export default privacy ;
